import { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { ToastContainer } from 'react-toastify'
import 'react-toastify/dist/ReactToastify.css'
import { BackButton } from '../components/BackButton'
import Spinner from '../components/Spinner'
import UserItem from '../components/UserItem'
import { deleteUser, getUsers } from '../features/auth/authSlice'

function ManageUsers() {
  const dispatch = useDispatch()
  const { users, isLoading } = useSelector((state) => state.auth)

  useEffect(() => {
    dispatch(getUsers())
  }, [dispatch])

  const handleDelete = (userId, userName) => {
    dispatch(deleteUser(userId)).then(() => {
      dispatch(getUsers())
    })
    console.log(`User ${userName} was deleted`)
  }

  if (isLoading) {
    return <Spinner />
  }

  return (
    <>
      <BackButton url="/" />
      <ToastContainer />
      <h1>Manage Users</h1>
      <div className="users" style={{ paddingBottom: '20px' }}>
        <div className="user-headings">
          <div>Name</div>
          <div>Email</div>
          <div>Role</div>
          <div></div>
        </div>
        {users?.length > 0 ? (
          users.map((user) => (
            <UserItem key={user._id} user={user} onDelete={handleDelete} />
          ))
        ) : (
          <p>No users found</p>
        )}
      </div>
    </>
  )
}

export default ManageUsers
